import styled from "styled-components";
import { colors, rawColors } from "../locales/colors";

export const MainMenuBox = styled.div`
  background-color: ${colors.bg};
  height: 200px;
  width: 20%;
  position: absolute;
  right: 0px;
  border-width: 2px;
  border-color: ${rawColors.green1_300};
  border-radius: 300px;
`;
